import React from 'react';

const Navbar: React.FC = () => {
    return (
        <nav>
            <ul>
                <li><a href="#playlists">Playlists</a></li>
                <li><a href="#articles">Articles</a></li>
                <li><a href="#previous-papers">Previous Papers</a></li>
            </ul>
        </nav>
    );
};

export default Navbar;
